import React from 'react';
import { Table } from 'antd';

const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
    },
    {
      title: 'Crag',
      dataIndex: 'crag',
    },
    {
      title: 'Sector',
      dataIndex: 'sector',
    },
  ];
  const data = [
    {
      key: '1',
      name: 'John Brown',
      age: 32,
      address: 'New York No. 1 Lake Park',
    },
    {
      key: '2',
      name: 'Jim Green',
      age: 42,
      address: 'London No. 1 Lake Park',
    },
    {
      key: '3',
      name: 'Joe Black',
      age: 32,
      address: 'Sidney No. 1 Lake Park',
    },
  ];

class PathsList extends React.Component {

    constructor(props){  
        super(props);  

        this.props.elements.map( element => element.key = '1')
    }  

    render() {
        return (
            <Table columns={columns} dataSource={this.props.elements} size="middle" />
        );
    }
}

export default PathsList;
